static const uint8_t JMLIB[] = {
    1,
    0x3A
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMLIData(char *Buffer)
{
    memcpy(Buffer, &JMLIL0[1], JMLIL0[0] << 2);
    Buffer += (JMLIL0[0] << 2);

    memcpy(Buffer, &JMLIL1[1], JMLIL1[0] << 2);
    Buffer += (JMLIL1[0] << 2);

    memcpy(Buffer, &JMLIL2[1], JMLIL2[0] << 2);
    Buffer += (JMLIL2[0] << 2);

    memcpy(Buffer, &JMLIL3[1], JMLIL3[0] << 2);
    Buffer += (JMLIL3[0] << 2);

    memcpy(Buffer, &JMLIL4[1], JMLIL4[0] << 2);
    Buffer += (JMLIL4[0] << 2);

    memcpy(Buffer, &JMLIL5[1], JMLIL5[0] << 2);
    Buffer += (JMLIL5[0] << 2);

    memcpy(Buffer, &JMLIB[1], JMLIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMLIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMLIData(void)
{
    remove(JMLIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMLIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMLIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMLIName)) return "";
    #endif

    if (!(han = fopen(JMLIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMLIData);

    num = fwrite(&JMLIL0[1], 4, JMLIL0[0], han);
    if (num != JMLIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMLIL1[1], 4, JMLIL1[0], han);
    if (num != JMLIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMLIL2[1], 4, JMLIL2[0], han);
    if (num != JMLIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMLIL3[1], 4, JMLIL3[0], han);
    if (num != JMLIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMLIL4[1], 4, JMLIL4[0], han);
    if (num != JMLIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMLIL5[1], 4, JMLIL5[0], han);
    if (num != JMLIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMLIB[1], 1, JMLIB[0], han);
    if (num != JMLIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMLIName;
}

